library rc4;

import 'package:unittest/unittest.dart';
import 'package:range/range.dart';
import '../lib/rc4.dart';
import 'dart:math';

void main() {
  group('Full Test', () {
    const String key = "This is a test";
    const String message = "Attack at dawn!";

    test('General Setup', () {
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "TVwO6ouZIc8d2FjL5lf8");
      expect(decrypted, message);
    });

    test('No-Drop Frame', () {
      RC4 rc4 = new RC4(key, 0);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "4xZ3pgZc9X4BNL5Qj2ND");
      expect(decrypted, message);
    });

    test('Invalid Custom Drop Frame', () {
      try {
        new RC4(key, 255);
        expect(false, true);
      } catch(e) {
        expect(e.toString(), 'Exception: Drop Bytes must be multiple of 256, was <255>.');
      }
    });

    test('Valid Custom Drop Frame', () {
      RC4 rc4 = new RC4(key, 256 * 32);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(encrypted, "2q8OLeHYdNhX31pJruWB");
      expect(decrypted, message);
    });

    test('Random (fixed seed) key/message', () {
