    test('Long Message', () {
      String longMessage = '';
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);

      expect(decrypted, message);
    });

    test("Foo",(){
      var message = '{"id":"feddb137","topic":"store","data":"{\"response\":\"asset\",\"asset\":{\"id\":\"52c6eb4b626a7c9175c7c1b7\",\"name\":\"Grass\",\"description\":\"Light grass best for X games.\",\"thumbnail\":\"\"}}"}';
      RC4 rc4 = new RC4(key);
      var encrypted = rc4.encode(message);
      var decrypted = rc4.decode(encrypted);
      expect(decrypted, message);
    });
  });
